import React from 'react'

const WorkoutItem = (props) => {
    return (
        <React.Fragment>
            <div className="itemContainer">
                <div style={{ textAlign: 'left' }}>
                    Leg Press
                </div>
                <div style={{ textAlign: 'right' }}>
                    4x12
                </div>
            </div>
            <style jsx>{`
                .itemContainer{
                    border-bottom: #C4C4C4 1px solid;
                    margin-bottom: 10px;
                }

            `}</style>
        </React.Fragment >
    )
}

export default WorkoutItem
